import axios from "../../axios"
import {AppDispatch} from "../index"
import {destinationSlice} from "../slices/destinationSlice"

export const fetchDestinations = (page = 1, count = 50) => {
    return async (dispatch: AppDispatch) => {
        try {
            dispatch(destinationSlice.actions.fetching())
            const response = await axios.get("posts")

            dispatch(destinationSlice.actions.fetchSuccess({destinations: response.data.posts}))
        } catch (e) {
            dispatch(destinationSlice.actions.fetchError(e as Error))
            console.log(e)
        }
    }
}
